/**
 * @Author: sunhaijian
 * @Date: 2020/6/8
 * @Description:
Given a string S and a string T, find the minimum window in S which will contain all the characters in T in complexity O(n).

Example:

Input: S = "ADOBECODEBANC", T = "ABC"
Output: "BANC"
Note:

If there is no such window in S that covers all characters in T, return the empty string "".
If there is such window, you are guaranteed that there will always be only one unique minimum window in S.

https://labuladong.gitbook.io/algo/di-ling-zhang-bi-du-xi-lie/hua-dong-chuang-kou-ji-qiao-jin-jie

 经典滑窗问题。



还有字符串常量过长，需要使用stringbuffer 来做转换。
 这个题有点坑，浪费了好多时间在Integer ==上面，对于这种类型记住要使用.equals
 **/
public class Minimum_Window_Substring_76 {

    @Test
    public void test(){

//        String S = "ADOBECODEBANC", T = "ABC";
//        String S = "aa", T = "aa";


         StringBuilder S= new StringBuilder();
         S.append("" +
                 "" +
                 "qblnua");
        S.append("" +
                 "" +
                 "ocvql");
        S.append("" +
                 "" +
                "" +
                "uycjsjyl" );
        S.append("" +
                "" +
                "" +
                "" +
                 "jareufebeohqqeykjwrif");
        String T= new String("" +
                "" +
                "" +
                "qsauzuqnytdpfrsxovkakxvcmm");

//        System.out.println(S.charAt(0));

        System.out.println(JSONObject.toJSONString(minWindow(S.toString(),T)));
    }


    public String minWindow(String s, String t) {

        Map<Character,Integer> need=new HashMap<>();
        Map<Character,Integer> window=new HashMap<>();

        for (char c :t.toCharArray()) {
            need.put(c, need.getOrDefault(c, 0) + 1);
        }

//        for (char c :s.toCharArray()) {
//            window.put(c, window.getOrDefault(c, 0) + 1);
//        }
//        System.out.println(JSON.toJSONString(window));
        int left =0,right=0;
        int valid=0;
        //记录最小覆盖子串的起始索引和长度
        int start=0,len=Integer.MAX_VALUE;
        int i=0;
        while(right<s.length()){
//            c是将要移入窗口的字符
            char c=s.charAt(right);
            //右移窗口
            right++;
//            进行窗口内数据的更新
            if(need.containsKey(c)){
                window.put(c,window.getOrDefault(c,0)+1);
                if(window.get(c) .equals(need.get(c)) ){
                    valid++;
                }
            }

//            System.out.println(11);
//            判断左侧窗口是否要收缩
            while (valid==need.size()){
//                再这里更新最小的覆盖子串
                if(right-left<len){
                    start=left;
                    len=right-left;


                }
//                d是将移出窗口的字符
                char d=s.charAt(left);
//                左移窗口
                left++;
//                进行窗口内数据的一系列更新
                if(need.containsKey(d)){
                    if(window.get(d).equals(need.get(d))){
                        valid--;
                    }
                    window.put(d,window.get(d)-1);
                }
            }

        }


        return len==Integer.MAX_VALUE?"":s.substring(start,start+len);

        
    }
}
